import "../assets/index.css";
import Head from "next/head";

export default function MyApp({ Component, pageProps }) {
  return (
    <>
      <Head>
        <title>My Store</title>
      </Head>
      <main>
        <Component {...pageProps} />
      </main>
    </>
  );
}
